fn read_data_from_file(file_id: &str, start_byte: i64, end_byte: i64) -> Result<reqwest::blocking::Response, Box<dyn Error>> {
    println!("{} start {} end", start_byte, end_byte);
    let endpoint_url = format!("https://www.googleapis.com/drive/v3/files/{file_id}?supportsAllDrives=true&supportsTeamDrives=true&alt=media");
    let client = reqwest::blocking::Client::new();
    if start_byte >= 0 && end_byte >= 0 {
        let resp = client.get(endpoint_url)
            .header(AUTHORIZATION, format!("Bearer {ACCESS_TOKEN}"))
            .header(RANGE, format!("bytes={start_byte}-{end_byte}"))
            .send()?;
        Ok(resp)
    } else {
        let resp = client.get(endpoint_url)
            .header(AUTHORIZATION, format!("Bearer {ACCESS_TOKEN}"))
            .send()?;
        Ok(resp)
    }
}

impl Filesystem for HelloFS {
    fn lookup(&mut self, _req: &Request, parent: u64, name: &OsStr, reply: ReplyEntry) {
        if parent == 1 && name.to_str() == Some("hello.txt") {
            reply.entry(&TTL, &HELLO_TXT_ATTR, 0);
        } else {
            reply.error(ENOENT);
        }
    }

    fn getattr(&mut self, _req: &Request, ino: u64, reply: ReplyAttr) {
        match ino {
            1 => reply.attr(&TTL, &HELLO_DIR_ATTR),
            2 => reply.attr(&TTL, &HELLO_TXT_ATTR),
            _ => reply.error(ENOENT),
        }
    }

    fn read(
        &mut self,
        _req: &Request,
        ino: u64,
        _fh: u64,
        offset: i64,
        size: u32,
        _flags: i32,
        _lock: Option<u64>,
        reply: ReplyData,
    ) {
        let (file_id, start_byte, end_byte) = calc(offset, size);
        println!("{} offset {} size", offset, size);
        if offset < 64 * 1024 {
            match read_data_from_file(file_id, -1, -1) {
                Ok(data) => {
                    let key = "E-bxU5geNyrojsSg2mqn5Yv1_veAczf0xaffrFJBSjk=";
                    let fernet = fernet::Fernet::new(&key).unwrap();
                    let decrypted_data = fernet.decrypt(&data.text().unwrap()).unwrap();
                    let test = String::from_utf8_lossy(&decrypted_data).unwrap();
                    // reply.data(&decrypted_data[0 as usize..size as usize]);
                    println!("{:#?}", test)
                }
                Err(e) => {}
            }
        } else {
            match read_data_from_file(file_id, start_byte as i64, end_byte as i64) {
                Ok(data) => {
                    // println!("{}", &data.bytes().unwrap().len());
                    // reply.data(&data.text().unwrap().as_bytes()[..size as usize]);
                    let resp_data = &data.bytes().unwrap();
                    reply.data(&resp_data[0 as usize..size as usize]);
                    println!("{:x?}", resp_data)
                }
                Err(e) => {}
            }
        }
    }

    fn open(&mut self, req: &Request, inode: u64, flags: i32, reply: ReplyOpen) {
        let inode = 7995404;
        println!("open() called for {:?}", inode);
        reply.opened(std::fs::File::open("test.txt").unwrap().as_raw_fd() as u64, 0)
    }

    fn readdir(
        &mut self,
        _req: &Request,
        ino: u64,
        _fh: u64,
        offset: i64,
        mut reply: ReplyDirectory,
    ) {
        if ino != 1 {
            reply.error(ENOENT);
            return;
        }

        let entries = vec![
            (1, FileType::Directory, "."),
            (1, FileType::Directory, ".."),
            (2, FileType::RegularFile, "hello.txt"),
        ];

        for (i, entry) in entries.into_iter().enumerate().skip(offset as usize) {
            // i + 1 means the index of the next entry
            if reply.add(entry.0, (i + 1) as i64, entry.1, entry.2) {
                break;
            }
        }
        reply.ok();
    }
}

